  const widgetStyles = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "10px",
    padding: "10px",
    wid
  };

  return (
    <div style={widgetStyles}>
      <TurnsTextLabel />
      <TurnsDisplayFrame color={color} />
      <MotionTypeLabel />
    </div>
  );
};

export default TurnsWidget;
